import React from 'react';
import '../Main.css';
import { CharacterPart } from './components/CharacterPart.js';
import { CharacterSelector } from './components/CharacterSelector.js';
import { CharacterCanvas } from './components/CharacterCanvas.js';
import { CharacterGenerator } from './components/CharacterRandomGenerator.js';



const Main = ({ Reminder, Generator, Donate }) => {
  return (
    <main id="generator" className= "main-inner">
    <Reminder />
    <Generator CharacterPart={CharacterPart} CharacterSelector = {CharacterSelector} CharacterCanvas ={CharacterCanvas} CharacterGenerator = {CharacterGenerator} />
    <Donate />
    </main>)
};

export {Main};
